            },
            scales: {
                x: { type: 'time', time: { displayFormats: { minute: 'HH:mm', hour: 'HH:mm' } }, grid: { color: 'rgba(255,255,255,0.03)' }, ticks: { maxTicksLimit: 14, font: { size: 10 } } },
                y: { title: { display: !!yTitle, text: yTitle||'', font: { size: 10 } }, grid: { color: 'rgba(255,255,255,0.03)' }, ticks: { font: { size: 10 } } }
            },
            elements: { point: { radius: 0 }, line: { borderWidth: 1.5 } }
        }
    });
}

function nz(times, vals) { return times.map((t,i) => ({x:t, y:vals[i]||null})).filter(p => p.y !== 0 && p.y !== null); }

mkChart('c1', [
    { label: 'Spot', data: nz(cT, DATA.classic.spot), borderColor: '#ffffff', borderWidth: 2.5 },
    { label: 'Zero Gamma', data: nz(cT, DATA.classic.zero_gamma), borderColor: '#fcb103', borderDash: [5,3] },
    { label: 'Call Wall Vol', data: nz(cT, DATA.classic.major_pos_vol), borderColor: '#00ff88', borderDash: [5,3] },
    { label: 'Put Wall Vol', data: nz(cT, DATA.classic.major_neg_vol), borderColor: '#ff4444', borderDash: [5,3] },
    { label: 'Call Wall OI', data: nz(cT, DATA.classic.major_pos_oi), borderColor: '#00ffff', borderDash: [2,2], borderWidth: 1 },
    { label: 'Put Wall OI', data: nz(cT, DATA.classic.major_neg_oi), borderColor: '#ff9900', borderDash: [2,2], borderWidth: 1 },
], 'Price Level');

mkChart('c2', [
    { label: 'Sum GEX Vol', data: nz(cT, DATA.classic.sum_gex_vol), borderColor: '#00d4ff' },
    { label: 'Sum GEX OI', data: nz(cT, DATA.classic.sum_gex_oi), borderColor: '#a855f7' },
], 'GEX Value');

mkChart('c3', [
    { label: 'Spot', data: nz(sT, DATA.state.spot), borderColor: '#ffffff', borderWidth: 2 },
    { label: 'Long Gamma', data: nz(sT, DATA.state.major_long_gamma), borderColor: '#00ffff', borderWidth: 2 },
    { label: 'Short Gamma', data: nz(sT, DATA.state.major_short_gamma), borderColor: '#ae4ad5', borderWidth: 2 },
], 'Price Level');

mkChart('c4', [
    { label: 'Spot', data: nz(sT, DATA.state.spot), borderColor: '#ffffff', borderWidth: 2 },
    { label: 'Major +Vol State', data: nz(sT, DATA.state.major_pos_vol), borderColor: '#00ff88', borderDash: [5,3] },
    { label: 'Major -Vol State', data: nz(sT, DATA.state.major_neg_vol), borderColor: '#ff4444', borderDash: [5,3] },
], 'Price Level');
</script>
</body>
</html>
